'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/tccw-unofficial-guide/docs/communities/','title':"Members Communities",'section':"Docs",'content':"Members Communities #  Facebook #   The Collective Canary Wharf The Collective Book Club  WhatsApp #  The collective members have created a number of WhatsApp chat groups for communities of interest. Use the links below to join:\n Board games Book club Buy/sell/swap Climbing/bouldering Collectivism Collective improvements Cooking Foodies LGBT Outdoor adventures/hiking Video games Poker  Skillshare #  The skillshare sheet can be used to connect with other members:\n If you have a skill or interest you would like to share If you have a skill or interest you would like to learn  Skillshare Google Doc\n"});index.add({'id':1,'href':'/tccw-unofficial-guide/docs/faq/','title':"FAQ",'section':"Docs",'content':"My WiFi / internet isn\u0026rsquo;t working #  How to Use OpenDNS or Google DNS on Your Mac\nMy neighbours loudly slam their doors! #  Find the offending room number and then raise a service ticket and maintenance will sort it out.\nHow do you turn up the sound in the cinema room? #  Contact the hub\nCan I drink the tap water? #  Yes - Report | Thames Water\nWhere can I find the latest cleaning schedule? #  Contact the hub\n"});index.add({'id':2,'href':'/tccw-unofficial-guide/docs/local-area/','title':"Local Area",'section':"Docs",'content':"Local Area Recommendations #  Please add any recommendations for services such as Doctors, Dry Cleaners, Notaries etc.\nRestaurants and Bars #  Royal China for good quality Chinese food incl. dim sum (Westferry)\nHazev for delicious Baklava and Turkish tea (South Quay)\nSupermarkets #  The Co-op\nTian Tian Market (for Asian produce)\nServices #  Hairdressers #  ADAM Grooming Atelier (Canary Wharf)\nHeadcase Barbers (Surrey Quays/Deptford)\nNomad Barbers (Brick Lane - City)\n"});index.add({'id':3,'href':'/tccw-unofficial-guide/docs/staff/','title':"Staff \u0026 Contacts",'section':"Docs",'content':"Staff who\u0026rsquo;s who #  Please update any useful info. about contacts amongst the collective staff:\n Kenneth Opoku - Community Manager  Contacting TCCW #  Contact the hub directly #   [Preferred] Text them on +44 7723 447 082 (note that the hub do not always seem to respond to emails/phone calls) Visit them in person on the ground floor of TCCW E-mail them hub.cw@thecollective.com  Support request system #  TCCW Support Requests\nThe support request systems appears to be an effective way to get a fast response.\nTCCW wiki #  TCCW Support/Zendesk\nThis is maintained by TCCW staff. Note that some info appears out of date.\n"});index.add({'id':4,'href':'/tccw-unofficial-guide/docs/clubs/book-club/','title':"Book Club",'section':"Clubs",'content':"Book Club #  Club info and book list TBD\nCollective Book Club Spreadsheet\n"});index.add({'id':5,'href':'/tccw-unofficial-guide/docs/clubs/running-club/','title':"Running Club",'section':"Clubs",'content':"Running Club #  Strava Page\n"});})();